import "./App.css";
import { BrowserRouter, Route } from "react-router-dom";
import MenuNav from "./components/landing/MenuNav";
import Main from "./components/landing/Main";
import LaMarque from "./components/landing/LaMarque";
import LaCollection from "./components/landing/LaCollection";
import Histoire from "./components/landing/Histoire";
// import Saludo from "./components/landing/Saludo";
// import Enlaces from "./components/landing/Enlaces";

function App() {
  return (
    <BrowserRouter>
      <div className="contenedor_principal">
        <div className="contenedor_menu_vertical">
          <MenuNav />
        </div>
        <div className="contenedor_contenidos">
          <Route exact path="/Main.js">
            <Main />
          </Route>
          <Route exact path="/LaMarque.js">
            <LaMarque />
          </Route>
          <Route exact path="/LaCollection.js">
            <LaCollection />
          </Route>
          <Route exact path="/Histoire.js">
            <Histoire />
          </Route>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
